Open Visual Studio Code and open the terminal. Pro Tip: If you‚Äôre new to Visual Studio Code and you want the editor to do something (say, for example, open a terminal), hold Ctrl + Shift and press P (or Cmd + Shift and press P on Mac). You can then type the thing you want to do, and it should show up in the list. Sometimes, like with Terminal, you might get a lot of results and the one you want might need a little scroll. Normally for a Terminal you want to use it internally, so you‚Äôd scroll to Terminal: Create New Terminal Open the terminal Navigate to an appropriate location for your projects such as your home directory or my documents, depending on your system. The easiest way to do this on Mac and Linux is to do cd ~ There isn‚Äôt really an equivalent on Windows, so if you aren‚Äôt sure you can instead use Explorer to open My Documents, right-click an empty space in the window, click ‚ÄúMore Options‚Äù then ‚ÄúOpen in Terminal‚Äù Run cargo new hello-world, and cargo will report that it has created the project Cargo is the program we‚Äôll use to run our rust programs as well as many of the rust tools that will help us along the way. Now in Visual Studio Code, go to File -> Open Folder and navigate to the hello-world folder we just created. You can see that cargo has created some files for us. We‚Äôre going to talk about the cargo files later but for now, head into the src directory and open main.rs You can see the file has already been created with the following code: fn main() { println!("Hello, world!");
} Before we dive into this further, lets run the program. Open the terminal again, as we did before. This time use cargo run to run our program, you should see something like the following: $ cargo run Compiling hello-world v0.1.0 (D:\Documents\hello-world) Finished dev [unoptimized + debuginfo] target(s) in 0.33s Running `target\debug\hello-world.exe`
Hello, world! Well, that was easy üòÖ You‚Äôll find the Rust community has put a lot of effort into making Rust as easy as possible to learn and use.

