To learn about memory, we‚Äôll make a simplified version of the guessing game from the official Rust book. Start by opening your terminal and navigating to where-ever your creating you projects like in the last chapter, then we‚Äôll create a new project with: cargo new guessing-game Open the project in you editor and open the file src/main.rs. As before we‚Äôll see the same ‚Äúhello, world‚Äù program: fn main() { println!("Hello, world!");
} As we step through this tutorial, if you mouse over the code examples, you can see some buttons that will let you ‚éò Copy the example to your clipboard ‚èµ Run the example via rust playground (where possible) üëÅ Show any code I‚Äôve opted to hide for clarity, try this on the next block Let‚Äôs quickly change our hello world message to something that welcomes us to the game. # fn main() { println!("Welcome to the guessing game!");
# } And ask the user to do something: # fn main() {
# println!("Welcome to the guessing game!"); println!("I have chosen a color red, green or blue, can you guess which?");
# } Because we‚Äôve used a second println! this will appear on a new line. The new line actually comes at the end of the println! so if you want to make both sentences appear on the same line, you can change the first one with print! (no ‚Äúln‚Äù). Try it out and see what else you might need to change! Let‚Äôs pick a color that the user has to guess. To begin with we‚Äôll just hard code one value, later we‚Äôll make it choose randomly. I‚Äôm going to choose blue, but you can choose whatever you like: # fn main() { let actual = "blue";
# println!("Welcome to the guessing game!");
# println!("I have chosen a color red, green or blue, can you guess which?");
# } Before we move on, I want to call out the ‚Äútype‚Äù of the data we‚Äôve just created. We‚Äôre going to talk about types in the next chapter, but I want to quickly point some things out. The type of data describes a number of things but mainly, how that data is represented in memory and how it can be used. For example, is the data a string (like ‚Äúblue‚Äù), or a number, or a boolean that represent true or false. If you‚Äôre using an editor that shows type information you might see that next to actual its written something like : &str, eg: type-annotation.png This means that the variable actual contains a ‚Äúreference‚Äù (represented by the &) to a ‚Äústring slice‚Äù (represented by str). We‚Äôll talk about why the variable only contains a reference and not the data itself later. You could, if you like, manually write this let actual: &str = "blue" yourself, however, it‚Äôs generally better to let Rust infer the type, and only write it yourself if either Rust is unable to decide (because it could be multiple things) or if you want to use something different. This is why it‚Äôs a good idea to make sure whatever you‚Äôre writing Rust in shows you what Rust has decided a type is. For example, the default integer type in Rust is i32 (don‚Äôt worry, we‚Äôll explain this later), however your program might have specific requirements that make it sensible to annotate the type so that Rust uses a u64 instead. (Yes, Rust has many different types for representing numbers, we‚Äôll worry about that next time üòä) inferred-vs-annotated.png Anyway, back to the program: let‚Äôs output the color. This will end up being the last thing in the program, but we can use this to check everything is working ok: # fn main() {
# let actual = "blue";
# println!("Welcome to the guessing game!");
# println!("I have chosen a color red, green or blue?"); println!("The color I chose was {actual}");
# } We can run this now and see that the color to be guessed was entered. Great‚Ä¶ but not much of a game is it. In order to get some user input, we need to read from the terminal. Before we tell the user what the actual color was lets ask them to guess # fn main() {
# let actual = "blue";
# println!("Welcome to the guessing game!");
# println!("I have chosen a color red, green or blue");
# println!("Enter your guess: red, green or blue");
# # println!("The color I chose was {actual}");
# } We‚Äôre then going to read a line of input from the user. When the program runs in the terminal, we can ask the user to type things, regardless of whether you are on Windows, Mac or Linux, this input is passed into the program through a stream of data called stdin (standard in). Rust comes with a ‚Äústandard library‚Äù (the name is unrelated to the stream) that we can access as a module called std. I pronounce this S T D, but you may also here people call it ‚Äústud‚Äù. Modules in Rust are a way of grouping up other bits of code such as functions, data types and even other modules. We‚Äôll talk about them more in a future lesson. Inside of this is another module called io that deals with input and output. If we weren‚Äôt using the println! macro, this is where we‚Äôd have to come to write things out to the terminal too, via a stream called stdout (standard out). For completion‚Äôs sake I should mention there is one more stream called stderr (standard error). This is also an output stream that we can use to separate ‚Äúgood‚Äù output that is relevant to the normal use of the program to really any other kind of output, whether that be errors or just information not directly relevant to the main output. For example, on Mac and Linux, if you use cargo run 2> /dev/null to run your program, you‚Äôll see that you lose the messages about your program being compiled because we redirected stderr (stream 2) to the void of /dev/null, and Cargo sensibly decided that it‚Äôs output is not relevant to your programs normal output On Windows the same can be achieved in cmd using cargo run 2> nul (note, only one l in nul), or in powershell with cargo run 2> $null (two l‚Äôs this time and a dollar, no idea why it‚Äôs different) stderr is really useful for things like logging, and we‚Äôll talk more about streams in the future, but if you want to quickly write something to this stream you can use eprintln! and eprint! the same way we use println! and print! So, we get stdin using std::io::stdin(), this is a function call (we‚Äôll talk about functions in a couple of chapters), that returns something called a ‚Äúhandle‚Äù that we can use for temporary access to the input stream. The double colons just tell Rust that you‚Äôre looking for something inside a module. We‚Äôll cover modules in detail later, including how, why and when to make your own, as well as better ways to access them, but since we only need to write this line once, this is the easiest way to do it. We could store the result of stdin() in a variable, however, we only use this once, and then we‚Äôre done with it, so, off the back of the function call, we can call immediately call .lines(). This is a method (a special type of function that belongs specifically to some other thing, in this case it belongs to the handle for stdin). In the example below I‚Äôve put this on a new line for legibility, but you don‚Äôt need to do this. .lines() returns an iterator, allowing us to iterate (step through) each line one at a time. We get the next line by calling .next() on the iterator. If we add this all in our code looks like this # fn main() {
# let actual = "blue";
# # println!("Welcome to the guessing game!");
# println!("I have chosen a color red, green or blue");
# # println!("Enter your guess: red, green or blue"); let input = std::io::stdin() .lines() .next() .expect("No input was read") .expect("There was an error when reading the input"); println!("Your guess was {input}");
#
# println!("The color I chose was {actual}");
# } Wait wait wait, what are those expects about?! expect() is, I would say, the second-worst way you could handle something going wrong in your program. This is not ‚Äúidiomatic‚Äù and you absolutely should not use this in anything except the most throw away software as it will immediately cause the program to stop and spew a lot of information at the user. In the future we‚Äôll talk about things going wrong and how to better handle them, however, as this program is just for you, I think you‚Äôll cope for now. üòä That doesn‚Äôt explain what these lines are doing, or why there are two of them though. The reason for this is that there are two possible ways .lines() might not work. The first expect then: .expect("No input was read") When we call .next() on any iterator, there either is something next or there isn‚Äôt. In some languages this might return either the data you expect, or a null value. For example, it might return "red" or null. ‚Äúred‚Äù is a string but null is not, what happens if you pass this to a function that expects a string? This means you must either manually check the thing returned was null, or don‚Äôt check, and risk your program breaking at some other point. Obviously many people think this ambiguity is bad, including Tony Hoare, arguably the ‚Äúinventor‚Äù of this behavior, who has called it his ‚Äúbillion-dollar mistake‚Äù. Rust does not allow you to use types like this interchangeably, i.e. data can not be a string or null as these types are not compatible. In Rust, we use a kind of container type to get around this called Option. Importantly, when a function returns an Option type you, the programmer, must check to see if it contains something, and then extract the thing if it‚Äôs there. There are a number of ways to do this and .expect is one of the worst ways to do this (we‚Äôll talk about better ways in the future), as it will attempt to extract the data if its there, or stop the program abruptly with the provided error message if it‚Äôs not. For the time being we‚Äôre going to just say we can‚Äôt deal with it not being there, we don‚Äôt want to continue running the program, and we want the program to stop. We use .expect("message") to say, if this is nothing, we are giving up, stop the program and print our message (plus a few other useful bits) to the stderr (see above). You can see why this behaviour is typically undesirable but that we can allow it for this example, at least until we learn how to deal with Option properly. The second expect is a bit different: .expect("There was an error when reading the input"); If the Option we got from .next() contains something instead of nothing, it still doesn‚Äôt necessarily mean we read the users input correctly, reading data from stdin is itself fallible. Fallibility, the nature that something may go wrong, in programming is another thing we‚Äôve traditionally handled very badly. A common way to deal with this in other languages is to stop executing and ‚Äúthrow‚Äù an error. The problem with throwing errors is that it breaks the flow of execution, the next thing to get executed is not obvious, it‚Äôs going to be wherever the error is ‚Äúcaught‚Äù‚Ä¶ if it‚Äôs ‚Äúcaught‚Äù. Sometimes you may not even realise that some code you‚Äôve written could throw an error because you‚Äôve called someone else‚Äôs code, and they didn‚Äôt make it obvious that their code could fail. Rust does away with this with another type called Result. If your function can fail, it must return a Result type. Like with Option, Result is its own type that contains either the data we wanted, or an error. Again, the idiomatic way to handle this depends on what you‚Äôre trying to do; is the error recoverable (could the program continue despite the error), and how do we want to report the error back to the user. Using expect will, again, cause the program to immediately stop with the error message and other bits sent to stderr, and again, you can see why this is typically extremely undesirable. But anyway, we now have a working program, there is an actual color, the user guesses a color, and we print both to the screen.

