So now, hopefully, you‚Äôre eager to write a load of code and then write a load of tests, but wait! As we alluded to at the top of chapter, and again halfway through, the point of tests isn‚Äôt to test that your code does what you think it does, it‚Äôs to make sure it does what it‚Äôs supposed to do. The best way to achieve this is to work out what your code is supposed to do, then write the test, then write the code. This is called Test Driven Development (TDD). Let‚Äôs try some TDD. We‚Äôll create a function that checks if a given string is a palindrome (a word that‚Äôs the same forwards and backwards). We‚Äôll start by writing our test: #[cfg(test)]
