# assert!(is_palindrome("kayak"));
# assert!(is_palindrome("racecar"));
# assert!(!is_palindrome("wood")); }
} Link to tests We use the todo! macro to state we are intending to come back and fix this code soon. It works even in our function that‚Äôs supposed to return a boolean because Rust recognises that the todo macro will kill the program, and therefore the function can will never return. We‚Äôve also used an underscore on the front of the _input parameter just to let Rust know that we know that parameter isn‚Äôt used yet (otherwise it‚Äôll warn us about it). Let‚Äôs think about our implementation. The string slice type doesn‚Äôt have a reverse method built in to it and even if it did, that would require allocating memory. Instead, lets use the chars iterator like we did earlier, we‚Äôll create two iterators, reverse one of them, then zip them together. If every character matches its counterpart then the string is a palindrome. fn is_palindrome(input: &str) -> bool { let forward = input.chars(); let backward = forward.clone().rev(); forward.zip(backward).all(|(f, b)| f == b)
} #[cfg(test)]
