The perennial of questions when it comes to testing: How many tests should you write? The important thing here is ‚Äúcoverage‚Äù. Do you have a test that ‚Äúcovers‚Äù each line of code. Take for example this really silly function: fn is_positive(num: i32) -> bool { if num > 0 { true } else { true }
} If we only test this function by giving it a number greater than 0, we‚Äôll only ‚Äúcover‚Äù the line first branch of the if, we miss the fact there is a mistake in the second branch. So what percent coverage should you aim for? Anecdotally, when I was creating my own API framework in PHP, I decided I wanted to get 100% coverage, that is, every line should have a test that hits it. The very last line that was uncovered was: } I wondered if it was worth the effort, decided it was. The reason this was the last uncovered line was that it was part of a nested if. I‚Äôd tested what happens if you went into both ifs, what happens if you didn‚Äôt go into the first, but not what happens if you went into the first, but not the second. function example() { if first_condition { if second_condition { return do_something(); } } // <- It was this line return do_something_else();
} I wrote the test and‚Ä¶ found a bug so severe that I had to rewrite almost a third of the framework. Should have written the tests first, right? My personal feelings are that you as an engineer should strive for 100% coverage of your code. As a manager or engineering lead though, test coverage is a terrible metric. Test coverage doesn‚Äôt tell you if the test was any good. If you make arbitrary metrics like this, you‚Äôre not improving code quality, engineers will write tests that meet that metric, but don‚Äôt for-fill the reason we want tests in the first place which is to answer: ‚Äúdoes this code do what we want it to do?‚Äù. As an engineer, it‚Äôs a matter of pride. Get your code right now, and you won‚Äôt have to deal with it later. As a leader, make sure your engineers are encouraged to be the best they can. That means giving them the time to write tests first, giving them access to the resources they need to learn how to write the best tests, etc.

