In order to show the value of documentation, we‚Äôre going to create our first Rust library. Up to now, we‚Äôve been building binaries. Rust compiles main.rs into an executable, but our projects can link to and, use functionality from, libraries. This is particularly helpful when sharing and reusing code. We‚Äôll be talking much more about how we share code with each other when we cover the Rust ecosystem, but even as we‚Äôre just learning the language, we can leverage the power of libraries for things like code reuse within the same project. Let‚Äôs try it out. First, lets make a normal program, remember you can do this with something like: cargo new iriss-documentation In main.rs, we‚Äôll make a single function and our main program will just check it works. fn add(a: usize, b: usize) -> usize { a + b
} fn main() { assert_eq!(add(40, 2), 42);
} Next, lets migrate the add function to a library. Create a new file called lib.rs. In the same way that main.rs is the entry to our binary, lib.rs is the entry point to our library. Our library acts like any other module and the module is named the same thing as our project (though swap hyphens - for underscores _). Anything public in lib.rs will be available to anyone using the library. We‚Äôll move our add function to the lib.rs and make it public so that we can access it from main.rs: // lib.rs
pub fn add(a: usize, b: usize) -> usize { a + b
} We can now use this function in our main function via the project module (eg, iriss_documentation). # // This is included for `mdbook test` which I'm using to check for obvious mistakes,
# // this _should_ be in lib.rs in your project and not in a module
# mod iriss_documentation {
# pub fn add(a: usize, b: usize) -> usize {
# a + b
# }
# }
// main.rs
use iriss_documentation::add; fn main() { assert_eq!(add(40, 2), 42, "We expect 40 + 2 = 42");
} ‚ÑπÔ∏è Note: Although our project name is iriss-documentation with a hyphen, the library name will be iriss_documentation with an underscore. If we run our program right now, you can see that it still works but‚Ä¶ we‚Äôre not really taking advantage of the library though, what‚Äôs the difference between this and what we had before? The main way you‚Äôre likely to share code is through Rusts package management system called Crates. Were you to publish this project right now (please don‚Äôt though, this project is obviously pretty useless üòÖ), then theoretically other people could use your add() function. But, we aren‚Äôt going to cover Crates at all in the language basics portion of this book. That doesn‚Äôt mean this technique isn‚Äôt useful though. To show how it can be useful, lets make another change to our project. Now that we‚Äôve got our lib.rs, lets move main.rs to bin/main.rs. The program still runs if you use cargo run but if you look closely there is a difference. Before: Before we moved to bin After: After we moved to bin In the last line, you‚Äôll see the name of the binary has changed from iriss-documentation.exe to main.exe. This is because when the project was a single binary file, the executable was simply named after the project. By using the bin directory, we‚Äôre telling Rust we expect to produce multiple binaries from this project, so now it takes the name from the file name instead of the project. To fix this, rename bin/main.rs to bin/iriss-documentation.rs and cargo will go back to creating iriss-documentation.exe. You can now create more binaries in this directory called different things and all of them will have access to the library we‚Äôve created! Feel free to try this out, but bear in mind that once you have more than one file in that directory, you will have to tell cargo which binary you want it to focus on. For example: cargo run --bin iriss-documentation

