Comments are used to communicate information to anyone reading the source code, but are completely ignored by the compiler. We usually talk about two styles of comments: Line comments: starting at // and ending at the end of the line Block comments: starting at /* and ending with */ Many languages like Java, JavaScript, PHP, and more, also support a special type of comment called a Doc Comment. Like comments, these are to convey information about nearby code, and are ignored by the compiler, however you can use documentation tooling to read them and produce the documentation for you. Rust takes this idea and turbocharges it‚Ä¶ but we‚Äôll get to that. For now, there are two subtypes of Doc Comments: Outer Doc Comments Inner Doc Comments It‚Äôs possible to create these comments as either line comments or block comments however , the convention [1] is to always use line comments, even if the comment spans many lines. The reason for this appears to be ambiguity in terminating block comments, and the desire for consistency. Outer Doc Comments are placed before the thing that‚Äôs being documented and use /// for each line of the comment, and we‚Äôll use them for most things like modules, types and our add() function. /// Adds two numbers together.
pub fn add(a: usize, b: usize) -> usize { a + b
} We can re-run cargo doc and refresh the page in our browser and our add function now has a little explanation. add() description That‚Äôs neat, but we could have worked that out from the name. Rust documentation uses markdown, which means we can use formatting and code snippets, as well as consecutive lines being treated as a single paragraph. Let‚Äôs add some more detail and explain how to use the function using the same technique we learned in the last chapter, assertions. Doing it this way may seem odd, but all will be explained in a moment. /// Adds two numbers together.
///
/// You can use this function to add two `usize` numbers together. It's a little bit pointless, obviously, we're only
/// doing this to demonstrate the benefits of good documentation.
///
/// ```
/// use iriss_documentation::add;
///
/// let a = 40;
/// let b = 2;
/// let c = add(a, b);
///
/// assert_eq!(c, 42, "We expect {a} + {b} = 42");
/// ```
pub fn add(a: usize, b: usize) -> usize { a + b
} Rebuilding our documentation now gives us the code sample too, isn‚Äôt that cute! add() with code sample What‚Äôs also cool, is that if we go back to the top level of our library where our add function was listed, you can see that add now has a nice little summary, it‚Äôs the first line of our documentation. This is worth bearing in mind as you write your documentation. Try to keep this line terse but descriptive. Summary of add() Before we move on, we should also provide some documentation for our library. We can‚Äôt put Outer Doc Comments before the library because the library is the file. Instead, we use Inner Doc Comments, which are prefixed with //!. We do this at the top of the file. Let‚Äôs provide a little //! This library does little more than provide us a way of playing with documentation
//!
//! We can use all kinds of markdown in Doc Comments, including:
//!
//! Various
//! =======
//!
//! Heading
//! -------
//!
//! ### Styles
//!
//! Horizontal lines
//!
//! ---
//!
//! And even code!
//!
//! ```
//! println!("Hello, world!");
//! ``` /// ...
pub fn add(a: usize, b: usize) -> usize { /* ... */ } And all of this will render nicely into our documentation. Top level documentation ‚ÑπÔ∏è Note: You can use Inner Doc Comments for all sorts of things, like modules that are in curly brackets. But, again, the convention [1] is to only use Inner Doc Comments for files, whether thats your main library file, or module files (eg, my_module/mod.rs, or ./my_module.rs).

