Some people say tests should be the documentation, but here we say the documentation should be the tests! Well, ok, not the test, you absolutely should still write your unit tests, etc. üòÖ But without doing anything else to our project, try running cargo test. Doc-Tests There‚Äôs a few things to notice here. First, we seem to be getting three sets of tests. Second, we have two passing tests‚Ä¶ but we didn‚Äôt write any tests, did we? The order of test suites, and individual tests you see may differ from the above, but you should have one test suite for our library (lib.rs), one test suite for our binary (iriss-documentation.rs), and one for Doc-tests. The first two have no tests, but Doc-tests have two tests. What‚Äôs happened here is that cargo test is treating any code samples as tests (unless we ask it not to). Let‚Äôs quickly add a test to lib.rs to look more closely at the difference. //! ... /// ...
pub fn add(a: usize, b: usize) -> usize { /* ... */ } #[cfg(test)]
mod tests { use super::*; #[test] fn test_add() { let a = 40; let b = 2; let c = add(a, b); assert_eq!(c, 42, "We expect {a} + {b} = 42"); }
} Now when we run again we get some interesting comparison. Unit Tests: Unit Tests Doc Tests: Doc Tests In the unit test, the test name is the fully qualified path to the test function (test::test_add) In the doc tests, it‚Äôs the file, the name of the thing being documented (unless it is the file) and the line of the start of the code block. This makes them slightly less useful as tests. So why would we do it? Well, the leading cause of bad documentation, and the reason why people so often don‚Äôt bother writing it to start with is that it needs to be maintained. One of the worst things we can do in documentation is tell someone they can achieve an outcome in a particular way, then change the code so that particular way no longer works as expected. Writing our documentation as test ensures that our documentation is correct, and keeping our documentation right next to the thing being documented makes it trivial to update. Rust guarantees that if you said the code works in a particular way, so long as you also wrote an example with assertions, then the documentation is correct!

