rustfmt is a formatting tool for Rust. Programming language formatting tools allow you to configure how you want your code to look. For example: Do you like opening curly brakets on the end of a line, like this: fn example() { // ...
} or on a new line like this: fn example()
{ // ...
} Do you indent with four spaces: fn hello() { println!("Hello"); } or two: fn hello() { println!("Hello"); } Does the last item in a list across multiple lines have a trailing comma: let list = [ "one", "two",
] or not: let list = [ "one", "two"
] How many empty lines are allowed between lines of code in a function? etc‚Ä¶ Maintaining a consistent style improves the legibility of code, making it faster for engineers to read and understand what‚Äôs happening. This is true, even if you only write code for yourself, using familiar patterns reduces the cognitive load to parse what you‚Äôre looking at. When working together as a group, it‚Äôs important to come to an agreement as to how you will style your code together, but luckily a Formatter will reduce the burden of having to maintain the style once you‚Äôve picked what to use. Different languages have different ‚Äústyles‚Äù that they follow. Some older languages may have multiple well established styles to choose from. Luckily there‚Äôs an official Rust Style Guide that gives us a compelling reason in the community to all write code the same way, and Rust comes with its own formatter called ‚ÄúRust Format‚Äù that will automatically maintain the style for you! You can call Rust Format manually using cargo fmt and it will automatically reformat your entire project, however its definitely best if you can set your IDE to automatically run it any time you save a file. This will save you any big unexpected changes. If you just want it to tell you if anything is incorrectly formatted, you can use cargo fmt --check. We‚Äôll come back to this later! Finally, it might be that you and your team find some aspect of the official Rust Style Guide particularly egregious, that‚Äôs fine! Rust Format allows you to configure how it will format your code through rustfmt.toml. You can find a complete guide to what you can control, and how, here: https://rust-lang.github.io/rustfmt/ rustfmt now comes with the rust tool suite by default, but if for some reason you don‚Äôt have it, you can install it with rustup component add rustfmt
